import CustomButton from "../../components/button/Button"; 
import DonoPet from "../../assets/img_animal/model-contact.png";
import Consulta from "../../assets/img_animal/consulta01.jpg";
import Vacinas from "../../assets/img_animal/vacinas.jpg"; 
import Cirurgias from "../../assets/img_animal/"; // Exemplo de imagem para cirurgias
import Internacoes from "../../assets/img_animal/internacoes.jpg"; // Exemplo de imagem para internações
import Vermifugacao from "../../assets/img_animal/vermifugacao.jpg"; // Exemplo de imagem para vermifugação
import PulgasCarrapatos from "../../assets/img_animal/pulgas-carrapatos.jpg"; // Exemplo de imagem para controle de pulgas e carrapatos
import Nutricional from "../../assets/img_animal/nutricional.jpg"; // Exemplo de imagem para aconselhamento nutricional
import Emergencias from "../../assets/img_animal/emergencias.jpg"; // Exemplo de imagem para emergências veterinárias

import "./Servicos.css";

export default function Servicos() {
  const servicos = [
    { nome: "Consultas", imagem: Consulta },
    { nome: "Vacinas", imagem: Vacinas },
    { nome: "Cirurgias", imagem: Cirurgias },
    { nome: "Internações", imagem: Internacoes },
    { nome: "Vermifugação", imagem: Vermifugacao },
    { nome: "Controle de Pulgas e Carrapatos", imagem: PulgasCarrapatos },
    { nome: "Aconselhamento Nutricional", imagem: Nutricional },
    { nome: "Emergências Veterinárias", imagem: Emergencias }
  ];

  return (
    <div className="servicos-container">
      <main className="servicos-main-container">
        <h1>Serviços</h1>
        <p>Descubra nossos serviços:</p>
        <div className="cards-main-container">
          {servicos.map((servico, index) => (
            <a href="#" key={index} className="card-container">
              <img src={servico.imagem} alt={servico.nome} className="card-image" />
              <div className="card-content">
                <h3>{servico.nome}</h3>
                <span className="arrow">➡️</span>
              </div>
            </a>
          ))}
        </div>
      </main>
    </div>
  );
}
